import React from "react";
import axios from "axios"
// const ZWSID = "X1-ZWz1hiqiaku2ob_1pt0f";

function Zillow() {
  axios({
    method: "POST",
    url: "https://zillowdimashirokovv1.p.rapidapi.com/GetSearchResults.htm",
    headers: {
      "content-type": "application/x-www-form-urlencoded",
      "x-rapidapi-host": "ZillowdimashirokovV1.p.rapidapi.com",
      "x-rapidapi-key": "41f3f91b13mshaa0652a8c3b96f1p165abcjsn42e270cab71c",
      useQueryString: true,
    },
    data: {
      rentzestimate: [true, false],
      "zws-id": "X1-ZWz1hiqiaku2ob_1pt0f",
      citystatezip: "denver+colorado",
    },
  })
    .then((response) => {
      console.log(response);
    })
    .catch((error) => {
      console.log(error);
    });
}

export default Zillow;
